import React from "react";
import ".About.css";

function About() {
  return (
    <div>
      <h1 className="heading">Welcome to the Bookcase Application </h1>
      <p>The following application was created by Shari. </p>
      <p>
        This bookcase app displays a list of books that a user can save to a
        local bookcase Click on the "Add + " button to add a book to your
        bookcase. Use the search bar to find the latest books by name, author or
        description
      </p>
    </div>
  );
}

export default About;
